
function AJAX(a,b){var c=new XMLHttpRequest();c.open("GET",a,true);c.onreadystatechange=function(){if(this.readyState!==4){return}if(this.status!==200){return}document.querySelector(b).innerHTML=this.responseText};c.send()}function Menu_Ajax(b,a,d){var c=document.querySelectorAll(b);for(Menu_Links_Item=0;Menu_Links_Item<c.length;Menu_Links_Item++){c[Menu_Links_Item].addEventListener("click",function(f){f.preventDefault();var e=this.getAttribute("href");e=e.replace(".php",a+".php");AJAX(e,d)})}}Menu_Ajax(".Main_Menu a","-ajax",".Page");